tisfaction with each airfare purchase. You can now cancel your flight booking within 24 hours - 100% free of charge. With LookUpFare you can enjoy the benefits of MACP), and can cancel your ticket with a full refund within 24 hours after booking - no questions asked! For the low price of $14.99, you can rest easy as Travelpainters will refund 100% of the ticket cost. Key Features of MACP Allows you to cancel your booking for any reason within 24 hours without any penalty Cancel & reebok your flights within the same day without any penalty if there is a drop in price Free Seat Assignments for certain Airlines, qualifying rules and regulations apply Name changes are not allowed according to Airlines Policies, but some airlines allow minor corrections, usually involving 2-3 characters free of charge (Specific airline conditions applies) Low cost for high convenience - just $14.99 per person! MACP Terms & Conditions MACP Fees are added per pax and not per ticket This program is available to all Travelpainters customers If you are not interested in the program you can just click the \'NO\' button, the extra charge of $14.99 won\'t be calculated in your total ticket fare If you are cancelling your flight ticket within 24 hours of the booking, 100% of your ticket value is refunded, (excluding $14.99 the MACP Fee) By adding the MACP, <strong>you also agree to all of Travelpainters Terms and Conditions: </strong></p>\r\n<p align=\"justify\">This program is not applicable if your flight is with a low cost carrier (ticketless carrier) like Spirit Airlines or Frontier Airlines and if your travel is scheduled in the next 7 days You can apply for a cancelation and refund with us if the fare rules are applicable Refunds are not applicable if you\'re a \"no show\". \"No Show\" refers to the state where the passenger at the time of boarding does not show up and provides no warning to the airlines. We can accept refund requests only if we are able to secure waivers from the Airline to confirm that the following conditions have been met.</p>\r\n			</div>\r\n		</div>\r\n    	<div class=\"gap\"></div>\r\n    </div>','','full_html'),('node','commonpages',0,142,142,'und',0,'	<div class=\"container\">\r\n		<div class=\"row\">\r\n			<div class=\"col-md-12\">\r\n					<h2 align=\"center\"><strong>Check Booking Info</strong></h2>\r\n			</div>\r\n			\r\n		</div>\r\n		<div class=\"row\">\r\n			<div class=\"col-md-6 col-sm-6 col-xs-6\">\r\n				<a href=\"#\"><img class=\"img-sukh-20x20\" src=\"img/rrr.png\"/></a>\r\n				<button class=\"btn btn-primary center-block\" >Click For Info</button>\r\n			</div>\r\n			<div class=\"col-md-6 col-sm-6 col-xs-6\">\r\n				<a href=\"#\"><img class=\"img-sukh-20x20\" align=\"middle\" src=\"img/ee.png\" /></a>\r\n				<button class=\"btn btn-primary center-block\">Click For Info</button>\r\n			</div>		\r\n		</div>\r\n    	<div class=\"gap\"></div>\r\n    </div>','','full_html');
