INSERT INTO `field_data_field_top` VALUES ('node','page',0,129,129,'und',0,'<h3>Albuquerque to London</h3>\r\n            <p class=\"abhi_city_desc\">Looking for the best deals for flights from Albuquerque to London? Travel Painters offers the lowest fares for both direct and indirect routes between Albuquerque and London. When you book with Travel Painters you can be sure that you always get the best price available for your flight.</br>\r\n               <b>All the airlines, all the deals!</b></br>\r\n               Travel Painters finds the flight from Albuquerque to London that\'s right for you. Travel Painters compares hundreds of flights to London from a range of airlines, regular and low cost carriers, from the United States (United Airlines, American Airlines, Delta Airlines, US Airways) and abroad (AerLingus, British Airways, Air France, KLM, Etihad Airways, Emirates, Air Canada, Lufthansa, Turkish Airlines and Thai Airways and more).\r\n            </p>',NULL),('node','page',0,131,131,'und',0,'<h3>Auckland to Bangkok</h3>\r\n<p class=\"abhi_city_desc\">Looking for the best deals for flights from Auckland to Bangkok? Travel Painters offers the lowest fares for both direct and indirect routes between Auckland and Bangkok. When you book with Travel Painters you can be sure that you always get the best price available for your flight.<br>\r\n							<b>All the airlines, all the deals!</b><br>\r\nTravel Painters finds the flight from Auckland to Bangkok that\'s right for you. Travel Painters compares hundreds of flights to London from a range of airlines, regular and low cost carriers, from the United States (United Airlines, American Airlines, Delta Airlines, US Airways) and abroad (AerLingus, British Airways, Air France, KLM, Etihad Airways, Emirates, Air Canada, Lufthansa, Turkish Airlines and Thai Airways and more).\r\n							\r\n							</p>',NULL),('node','page',0,132,132,'und',0,'<h3>Albuquerque to Madrid</h3>\r\n<p class=\"abhi_city_desc\">Looking for the best deals for flights from Albuquerque to Madrid? Travel Painters offers the lowest fares for both direct and indirect routes between Auckland and Bangkok. When you book with Travel Painters you can be sure that you always get the best price available for your flight.<br>\r\n							<b>All the airlines, all the deals!</b><br>\r\nTravel Painters finds the flight from Albuquerque to Madrid that\'s right for you. Travel Painters compares hundreds of flights to London from a range of airlines, regular and low cost carriers, from the United States (United Airlines, American Airlines, Delta Airlines, US Airways) and abroad (AerLingus, British Airways, Air France, KLM, Etihad Airways, Emirates, Air Canada, Lufthansa, Turkish Airlines and Thai Airways and more).\r\n							\r\n							</p>',NULL),('node','page',0,133,133,'und',0,'<h3>Albuquerque to Paris</h3>\r\n<p class=\"abhi_city_desc\">Looking for the best deals for flights from Albuquerque to Paris? Travel Painters offers the lowest fares for both direct and indirect routes between Auckland and Bangkok. When you book with Travel Painters you can be sure that you always get the best price available for your flight.<br>\r\n							<b>All the airlines, all the deals!</b><br>\r\nTravel Painters finds the flight from Albuquerque to Paris that\'s right for you. Travel Painters compares hundreds of flights to London from a range of airlines, regular and low cost carriers, from the United States (United Airlines, American Airlines, Delta Airlines, US Airways) and abroad (AerLingus, British Airways, Air France, KLM, Etihad Airways, Emirates, Air Canada, Lufthansa, Turkish Airlines and Thai Airways and more).\r\n							\r\n							</p>',NULL),('node','page',0,134,134,'und',0,'<h3>Accra to London</h3>\r\n<p class=\"abhi_city_desc\">Looking for the best deals for flights from Accra to London? Travel Painters offers the lowest fares for both direct and indirect routes between Auckland and Bangkok. When you book with Travel Painters yo